import React from 'react';

const styles = {
    footerStyle: {
        backgroundImage: linearGradient(
            '-225deg',
            '#77a1d3 0 %',
            '#79cbca 56 %',
            '#e684ae 100 %'
        )
    },
    footingStyle: {
        fontSize: '100px',
    },
};

function Footer() {
    return (
        <footer style={styles.footerStyle} clasName="footer">
            <p>Social Icons Here</p>
        </footer>
    )
}

export default Footer;
